import React from 'react';
import { connect } from 'react-redux';
import { selectStrength, selectBodybuilding } from '../../actions/goal';
import { Grid, Container, Button, Image } from 'semantic-ui-react';
import { Link } from 'react-router-dom';
import './Homepage.css';

class Homepage extends React.Component {
	render(){
		return (
			<div>
				<Container>
					<h1 className="homepage_title">Four Walls of Iron</h1>
						<Grid stackable columns={2}>	
							<Grid.Column>
								<Image src={require('../Strength/StrengthImages/Strength.jpg')} fluid />
								<Link to="/maxes" onClick={this.props.selectStrength}>
									<h1 className="goal_title">Strength</h1>
								</Link>
							</Grid.Column>
							<Grid.Column>
								<Image src={require('../Bodybuilding/BodybuildingImages/Bodybuilding.jpg')} fluid />
								<Link to="/maxes" onClick={this.props.selectBodybuilding}>
									<h1 className="goal_title" style={{textAlign:'center'}}>Bodybuilding</h1>
								</Link>
							</Grid.Column>
						</Grid>
					</Container>
			</div>
		)
	}
}

export default connect(null, { selectStrength, selectBodybuilding })(Homepage);
